import data from './data'

function App() {
  const cards = data.map(item => {
    return (
      <Card
        img={katie}
        rating="5.0"
        reviewCount={6}
        country="USA"
        title="Life Lessons with Katie Zaferes"
        price={136}
      />
    )
  })

  return (
    <div className="App">
      <Nav />
      <Hero />

    </div>
  );
}

export default App;
